import React, { useState } from 'react';

// Icon components
const BackArrowIcon = () => (
  <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 19l-7-7 7-7" />
  </svg>
);

const ChartIcon = () => (
  <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
  </svg>
);

const CalendarIcon = () => (
  <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 7V3m8 4V3m-9 8h10M5 21h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v12a2 2 0 002 2z" />
  </svg>
);

const TrendingUpIcon = () => (
  <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 7h8m0 0v8m0-8l-8 8-4-4-6 6" />
  </svg>
);

const FileTextIcon = () => (
  <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" />
  </svg>
);

interface LogAndTrackScreenProps {
  onBack: () => void;
  onNavigateToSymptomTracker?: () => void;
}

const LogAndTrackScreen: React.FC<LogAndTrackScreenProps> = ({ 
  onBack, 
  onNavigateToSymptomTracker 
}) => {
  const [selectedTimeframe, setSelectedTimeframe] = useState<'week' | 'month' | 'quarter'>('week');

  const timeframes = [
    { key: 'week', label: 'This Week', count: 12 },
    { key: 'month', label: 'This Month', count: 45 },
    { key: 'quarter', label: 'This Quarter', count: 128 }
  ];

  const quickActions = [
    {
      icon: <ChartIcon />,
      title: 'Symptom Tracker',
      description: 'Log and monitor symptoms',
      actionText: 'Log Symptom',
      variant: 'primary' as const,
      onClick: onNavigateToSymptomTracker
    },
    {
      icon: <CalendarIcon />,
      title: 'Health Calendar',
      description: 'View health events timeline',
      actionText: 'View Calendar',
      variant: 'secondary' as const,
      onClick: () => console.log('View Calendar')
    },
    {
      icon: <TrendingUpIcon />,
      title: 'Trends & Patterns',
      description: 'Analyze health patterns',
      actionText: 'View Trends',
      variant: 'secondary' as const,
      onClick: () => console.log('View Trends')
    },
    {
      icon: <FileTextIcon />,
      title: 'Health Reports',
      description: 'Generate health summaries',
      actionText: 'Create Report',
      variant: 'secondary' as const,
      onClick: () => console.log('Create Report')
    }
  ];

  const recentEntries = [
    {
      id: '1',
      type: 'symptom',
      title: 'Fatigue',
      severity: 3,
      timestamp: '2 hours ago',
      notes: 'Felt tired after lunch'
    },
    {
      id: '2',
      type: 'nutrition',
      title: 'Iron-rich meal',
      timestamp: 'Yesterday',
      notes: 'Spinach salad with lean beef'
    },
    {
      id: '3',
      type: 'medication',
      title: 'Vitamin D',
      timestamp: '2 days ago',
      notes: 'Taken with breakfast'
    }
  ];

  const getEntryIcon = (type: string) => {
    switch (type) {
      case 'symptom': return '😴';
      case 'nutrition': return '🥗';
      case 'medication': return '💊';
      default: return '📝';
    }
  };

  const getSeverityColor = (severity: number) => {
    switch (severity) {
      case 1: return 'bg-green-100 text-green-800';
      case 2: return 'bg-yellow-100 text-yellow-800';
      case 3: return 'bg-orange-100 text-orange-800';
      case 4: return 'bg-red-100 text-red-800';
      case 5: return 'bg-red-200 text-red-900';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-white shadow-sm border-b border-gray-200 px-4 py-3">
        <div className="flex items-center justify-between">
          <button 
            onClick={onBack}
            className="p-2 text-gray-400 hover:text-gray-600 transition-colors"
          >
            <BackArrowIcon />
          </button>
          <div className="flex-1 text-center">
            <h1 className="text-lg font-semibold text-gray-900">Log & Track</h1>
            <p className="text-sm text-gray-600">Monitor Jamie's health journey</p>
          </div>
          <div className="w-10"></div> {/* Spacer for centering */}
        </div>
      </header>

      {/* Main Content */}
      <main className="px-4 py-6">
        {/* Summary Stats */}
        <div className="mb-6 p-4 bg-gradient-to-r from-indigo-50 to-purple-50 rounded-xl border border-indigo-200">
          <div className="flex items-center justify-between mb-3">
            <h2 className="text-lg font-semibold text-gray-900">Health Summary</h2>
            <div className="flex space-x-2">
              {timeframes.map(timeframe => (
                <button
                  key={timeframe.key}
                  onClick={() => setSelectedTimeframe(timeframe.key as any)}
                  className={`px-3 py-1 rounded-full text-xs font-medium transition-colors ${
                    selectedTimeframe === timeframe.key
                      ? 'bg-indigo-600 text-white'
                      : 'bg-white text-gray-600 border border-gray-200 hover:bg-gray-50'
                  }`}
                >
                  {timeframe.label}
                </button>
              ))}
            </div>
          </div>
          <div className="grid grid-cols-3 gap-4 text-center">
            <div>
              <div className="text-2xl font-bold text-indigo-600">
                {timeframes.find(t => t.key === selectedTimeframe)?.count}
              </div>
              <div className="text-xs text-gray-600">Entries</div>
            </div>
            <div>
              <div className="text-2xl font-bold text-green-600">85%</div>
              <div className="text-xs text-gray-600">Compliance</div>
            </div>
            <div>
              <div className="text-2xl font-bold text-blue-600">12</div>
              <div className="text-xs text-gray-600">Active Days</div>
            </div>
          </div>
        </div>

        {/* Quick Actions */}
        <div className="mb-6">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Quick Actions</h3>
          <div className="grid grid-cols-1 sm:grid-cols-2 gap-4">
            {quickActions.map((action, index) => (
              <div key={index} className="bg-white rounded-xl border border-gray-200 p-4">
                <div className="flex items-start space-x-3">
                  <div className="flex-shrink-0 w-10 h-10 bg-indigo-100 rounded-lg flex items-center justify-center">
                    <div className="text-indigo-600">
                      {action.icon}
                    </div>
                  </div>
                  <div className="flex-1 min-w-0">
                    <h4 className="text-sm font-semibold text-gray-900">{action.title}</h4>
                    <p className="text-xs text-gray-600 mt-1">{action.description}</p>
                  </div>
                </div>
                <button
                  onClick={action.onClick}
                  className={`w-full mt-3 text-sm font-medium py-2 px-3 rounded-lg transition-colors ${
                    action.variant === 'primary'
                      ? 'bg-indigo-600 text-white hover:bg-indigo-700'
                      : 'text-indigo-600 hover:text-indigo-700 border border-indigo-200 hover:bg-indigo-50'
                  }`}
                >
                  {action.actionText}
                </button>
              </div>
            ))}
          </div>
        </div>

        {/* Recent Entries */}
        <div>
          <div className="flex items-center justify-between mb-4">
            <h3 className="text-lg font-semibold text-gray-900">Recent Entries</h3>
            <button className="text-sm text-indigo-600 hover:text-indigo-700 font-medium">
              View All
            </button>
          </div>
          <div className="space-y-3">
            {recentEntries.map(entry => (
              <div key={entry.id} className="bg-white rounded-xl border border-gray-200 p-4">
                <div className="flex items-start space-x-3">
                  <div className="flex-shrink-0 text-2xl">
                    {getEntryIcon(entry.type)}
                  </div>
                  <div className="flex-1 min-w-0">
                    <div className="flex items-center justify-between">
                      <h4 className="text-sm font-semibold text-gray-900">{entry.title}</h4>
                      <span className="text-xs text-gray-500">{entry.timestamp}</span>
                    </div>
                    {entry.severity && (
                      <div className="flex items-center mt-1">
                        <span className={`inline-flex items-center px-2 py-1 rounded-full text-xs font-medium ${getSeverityColor(entry.severity)}`}>
                          Severity {entry.severity}/5
                        </span>
                      </div>
                    )}
                    {entry.notes && (
                      <p className="text-xs text-gray-600 mt-2">{entry.notes}</p>
                    )}
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </main>
    </div>
  );
};

export default LogAndTrackScreen;
